INSERT INTO kysymysryhma (kysymysryhmaid, voimassa_alkupvm, voimassa_loppupvm, taustakysymykset, valtakunnallinen, nimi_fi, nimi_sv, selite_fi, selite_sv, koulutustoimija, oppilaitos, toimipaikka, luotu_kayttaja, muutettu_kayttaja, luotuaika, muutettuaika, tila, kuvaus_fi, kuvaus_sv, ntm_kysymykset) VALUES (3341885, NULL, NULL, true, true, 'Näyttötutkintojen taustakysymykset tutkinnon suorittamisvaiheessa', 'Bakgrundsfrågor gällande fristående examina vid avläggandet av examen', NULL, NULL, '0829731-2', NULL, NULL, 'JARJESTELMA', 'JARJESTELMA', '2014-12-22 11:37:26.532651+00', '2015-01-05 07:05:47.314088+00', 'julkaistu', NULL, NULL, false);
INSERT INTO kysymysryhma (kysymysryhmaid, voimassa_alkupvm, voimassa_loppupvm, taustakysymykset, valtakunnallinen, nimi_fi, nimi_sv, selite_fi, selite_sv, koulutustoimija, oppilaitos, toimipaikka, luotu_kayttaja, muutettu_kayttaja, luotuaika, muutettuaika, tila, kuvaus_fi, kuvaus_sv, ntm_kysymykset) VALUES (3341886, NULL, NULL, false, true, 'Näyttötutkintojen hakeutumisvaiheen kysymykset', 'Bakgrundsfrågor gällande fristående examina', NULL, NULL, '0829731-2', NULL, NULL, 'JARJESTELMA', 'JARJESTELMA', '2014-12-22 12:02:20.579318+00', '2015-01-16 10:04:58.392528+00', 'julkaistu', 'Hakeutumisvaiheella tarkoitetaan ajankohtaa, jolloin hakeuduit suorittamaan näyttötutkintoa tai sen osaa. Tässä vaiheessa oppilaitos tai oppisopimuskoulutuksen järjestäjä sopii kanssasi henkilökohtaisista järjestelyistä, joiden avulla saat suoritettua tavoitteesi mukaisen tutkinnon tai tutkinnon osan. Järjestelyt kirjataan henkilökohtaiseen suunnitelmaasi.', 'Med ansökningsskedet avses tidpunkten då du ansökte om att avlägga examen eller del av examen. I detta skede avtalar läroanstalten eller anordnaren av läroavtalsutbildningen med dig om de personliga arrangemang med hjälp av vilka du kan avlägga den examen eller del av examen som är ditt mål. Arrangemangen antecknas i din personliga plan.', false);
INSERT INTO kysymysryhma (kysymysryhmaid, voimassa_alkupvm, voimassa_loppupvm, taustakysymykset, valtakunnallinen, nimi_fi, nimi_sv, selite_fi, selite_sv, koulutustoimija, oppilaitos, toimipaikka, luotu_kayttaja, muutettu_kayttaja, luotuaika, muutettuaika, tila, kuvaus_fi, kuvaus_sv, ntm_kysymykset) VALUES (3341887, NULL, NULL, false, true, 'Näyttötutkintojen suorittamisvaiheen kysymykset', 'Avläggandet av examen gällande fristående examina', '', NULL, '0829731-2', NULL, NULL, 'JARJESTELMA', 'JARJESTELMA', '2014-12-22 12:38:00.024047+00', '2015-01-16 10:04:58.392528+00', 'julkaistu', 'Näyttötutkinnoissa ammattitaito osoitetaan ja arvioidaan tutkintotilaisuuksissa. Tutkinnon suorittamisella tarkoitetaan tilanteita, joissa osoitit tutkinnon perusteissa vaaditun osaamisen ja osaamisesi arvioitiin.', 'I fristående examina visas och bedöms yrkesskickligheten vid examenstillfällen. Med avläggandet av examen avses de situationer där du visade det kunnande som krävs i examensgrunderna och där ditt kunnande bedömdes.', false);
INSERT INTO kysymysryhma (kysymysryhmaid, voimassa_alkupvm, voimassa_loppupvm, taustakysymykset, valtakunnallinen, nimi_fi, nimi_sv, selite_fi, selite_sv, koulutustoimija, oppilaitos, toimipaikka, luotu_kayttaja, muutettu_kayttaja, luotuaika, muutettuaika, tila, kuvaus_fi, kuvaus_sv, ntm_kysymykset) VALUES (3341888, NULL, NULL, false, true, 'Näyttötutkintojen tarvittavan ammattitaidon hankkimisvaiheen kysymykset (mm. valmistava koulutus, oppisopimuskoulutuksen tietopuoliset opinnot sekä työssä oppiminen)', 'Avläggandet av examen gällande fristående examina (bl.a. förberedande utbildning, läroavtalsutbildningens teoretiska studier och inlärning i arbetet)', NULL, NULL, '0829731-2', NULL, NULL, 'JARJESTELMA', 'JARJESTELMA', '2014-12-22 14:43:53.188349+00', '2015-01-16 10:04:58.392528+00', 'julkaistu', 'Tarvittavan ammattitaidon hankkimisella tarkoitetaan oppimista, jota tarvitset tutkintosi suorittamiseksi. Oppimista tapahtuu työpaikalla, oppilaitoksessa ja esimerkiksi verkossa.', 'Med förvärvandet av behövlig yrkesskicklighet avses det lärande du behöver för att avlägga din examen. Lärandet sker på en arbetsplats, i en läroanstalt och till exempel på webben.', false);
